import React from 'react';
import LutriviaContainer from './components/LutriviaContainer';
import './App.css';

import data from './data'

class App extends React.Component {

  state = {
    questions: data
  }



  render() {
    return (
      <div>
        <LutriviaContainer questions={this.state.questions}/>
      </div>
    );
  }

}

export default App;
